import React, {useState, useEffect} from "react";


export default function CalculadoraPuntos({puntosActuales}){
  const [puntosSumados, setPuntosSumados] = useState(0);
  const [puntosTotal, setPuntosTotal] = useState(0);
  const [dineroTotal, setDineroTotal] = useState(0);
  const [calculadora, setCalculadora] = useState(false);
  const [input, setInput] = useState({
    dineroPorPunto: 0,
    nuevaCompra: 0,
    puntoCanjeado: 0
  })
  

  function handleInputChange(e){
    const { name, value} = e.target;
    setInput({
      ...input,
      [name]: parseFloat(value),
    });
  }

  function handleOpenCalculator(e){
    if(e === false){
      setCalculadora(false);
    }
    if(e === true){
      setCalculadora(true)
    }
  }

  useEffect(() => {
    const { dineroPorPunto, nuevaCompra, puntoCanjeado} = input;
    const nuevosPuntos = dineroPorPunto > 0 ? Math.floor(nuevaCompra / dineroPorPunto) : 0;
    
    setPuntosSumados(nuevosPuntos);
    setPuntosTotal(parseFloat(puntosActuales) + nuevosPuntos);
    setDineroTotal(parseFloat(puntosActuales) * puntoCanjeado);




  }, [input, puntosActuales]);
  
  
  
  return (
    <div>
    <div>
      <div>
        <h1>CALCULAR PUNTOS</h1>
        <button onClick={(e) => handleOpenCalculator(e = true)}>abrir</button>
        <button onClick={(e) => handleOpenCalculator(e = false)}>cerrar</button>
      </div>
      { calculadora ?
      <div>
      <div>
        <label>Dinero necesario por punto: $ </label>
        <input type="number" name="dineroPorPunto" value={input.dineroPorPunto} onChange={(e) => handleInputChange(e)}></input>
      </div>
      <div>
        <label>Monto de la nueva compra: $ </label>
        <input type="number" name="nuevaCompra" value={input.nuevaCompra} onChange={(e) => handleInputChange(e)}></input>
      </div>
      <div>
        <label>Puntos actuales del cliente: {puntosActuales} </label>
      </div>
      <div>
        <label>Puntos sumados en esta compra: </label>
        <span>{puntosSumados}</span>
      </div>
      <div>
        <label>Puntos totales del cliente: </label>
        <span>{puntosTotal}</span>
      </div> 
      </div> :
      <div></div>}
    </div> 
    <div>
    <div>
        <h1>CANJEAR PUNTOS</h1>
        <button>abrir</button>
        <button>cerrar</button>
      </div>
      <div>
        <label>Valor de punto canjeado: $ </label>
        <input type="number" name="puntoCanjeado" value={input.puntoCanjeado} onChange={(e) => handleInputChange(e)}></input>
      </div>
      <div>
        <label>Valor de puntos totales en dinero: $</label>
        <span>{dineroTotal}</span>
      </div>
    </div>
    </div>
  )
}
